import React from "react";
import "./Home.css";

const Home = () => {
  return (
    <div className="home">
      <h1>Nrithya Parichay</h1> <br></br>
      <p>"Unleashing the Beauty of Movement"</p>
    </div>
  );
};

export default Home;
